import React from 'react';
import CharSheet from './components/charsheet.js'
import ClassList from './api/classapi.js'
import RaceList from './api/raceapi.js'
import './App.css';


class ApiTransfer extends React.Component {
	state = {
		selectedClass: '',
		selectedRace: ''
	}
}


function App() {
  return (
    <div className='body'>
      <CharSheet state={this.state}/>
      <RaceList state={this.state}/>
      <ClassList state={this.state}/>
    </div>
  );
}

export default App;
